.content{
  height: 100%;
  position: relative;
  display: flex;
  justify-content: center;
  overflow: auto;
}
.main{
  width: 400px;
  height: auto;
  margin: auto;
}
.main > * {
  margin-bottom: 10px;
  margin-left: 8px;
}
.main_div{
  display: flex;
}

.main .header {
  height: 35px;
  width: 398px;
  line-height: 35px;
  margin-left: 15px;
  font-size: 16px;
}
.footer {
  position: relative;
  width: 398px;
  height: 32px;
  margin:auto;
}
.footer > * {
  position: absolute;
  left: 50%;
  top: 0;
  width: 80px;
}
.InputLabel{
  float:left;
  margin-right: 5px;
  font-size: 14px;
}
.Input{
  width:400px;
  height:40px!important;
  overflow: hidden!important;
}
.required{
  position:absolute ;
  top: 0;
  right: 0;
  color: red;
}
